import React, { Component } from 'react'
import logo from"../logo.svg"
import {Link} from "react-router-dom"
import styled from "styled-components"
export default class  extends Component {
    render() {
        return (
          <nav className="navbar navbar-expands-sm bg-primary navbar-dark px-sm-5">
              <Link to="/"> <img src={logo} alt="store" className="navbar-brand"></img></Link>
              <ul className="navbar-nav align-items-center">
                  <li className="nav-item ml-5">
                      <Link to="/" className="nav-link">Products</Link></li>
                      </ul>
                  <Link to="/cart" className="ml-auto">
                      <ButtonContainer>
                          <span className="mr-2"><i className="fas fa-cart-plus">my cart</i></span>
                          
                      </ButtonContainer>
                  </Link>
            
          </nav>
           
  
        )
    }
}

const ButtonContainer=styled.button`
    text-transform:capitalize;
    font-size:1.4rem;
    background:transparent;
    border:0.05rem solid var() 

`
